function sortDictByKey(dict) {
    return Object.keys(dict).sort().reduce((obj, key) => {
        obj[key] = dict[key];
        return obj;
    }, {});
}

// Example usage:
let dict = {'c': 3, 'a': 1, 'b': 2};
console.log(sortDictByKey(dict)); // Outputs: {'a': 1, 'b': 2, 'c': 3}
```

This function takes a dictionary as input and returns a new dictionary with the same keys and values but sorted by key alphabetically. It uses `Object.keys()` to get an array of the keys in the original dictionary, then sorts that array using `Array.prototype.sort()`. Finally, it reduces over this sorted array using `Array.prototype.reduce()`, creating a new object where each key-value pair is added in order from the sorted array.
